import React from 'react';
import '../App.css';
import { Link } from 'react-router-dom';
import Logo from '../Icons/icons8-sakura-96.png';

function Nav() {


  return (

    <nav>
    <img src={Logo}  alt="logo" />
      <ul className="nav-links">
        <Link className='nav-style' to='/graphs'>
        <li><h2>Graphs</h2></li>
        </Link>
        <Link className='nav-style' to='/map'>
        <li><h3>Map</h3></li>
        </Link>
      </ul>
    </nav>
  );
}
export default Nav;
